(window.webpackJsonp=window.webpackJsonp||[]).push([[28],{220:function(n,a,e){"use strict";e.r(a);a.default="import React, { useState } from 'react'\nimport Table, { Thead, Tbody, DragTr } from 'designare-table'\n\nconst originalData = [\n    { name: 'Johnson & Johnson', last: 135.7, chg: 2.33, chgp: 1.75 },\n    { name: 'Cisco Systems Inc.', last: 46.79, chg: 0.43, chgp: 0.93 },\n    { name: 'Walt Disney Co.', last: 130.86, chg: 1.10, chgp: 0.85 },\n    { name: 'Coca-Cola Co.', last: 53.49, chg: -0.02, chgp: -0.04 },\n    { name: 'Walmart Inc.', last: 119.42, chg: -0.11, chgp: -0.09 }\n]\n\nconst style = { cursor: 'move' }\n\nexport default function () {\n    const [data, setData] = useState(originalData)\n    const draggableTr = ({ cells, row }) => (\n        <DragTr\n            row={row}\n            getRowId={row => row.name}\n            style={style}\n        >\n            {cells}\n        </DragTr>\n    )\n\n    return (\n        <Table\n            data={data}\n            columns={[\n                {\n                    Header: 'COMPANY',\n                    dataKey: 'name'\n                },\n                {\n                    Header: 'LAST',\n                    dataKey: 'last'\n                },\n                {\n                    Header: 'CHG',\n                    dataKey: 'chg'\n                },\n                {\n                    Header: 'CHG%',\n                    dataKey: 'chgp'\n                }\n            ]}\n            onChangeRows={data =>\n                setData(data)\n            }\n        >\n            <Thead />\n            <Tbody tr={draggableTr} />\n        </Table>\n    )\n}"}}]);